  `pulse_offset` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '脉冲偏移（实际接收到的脉冲位置与理论上脉冲所在位置的偏差）',
