  `is_delete` varchar(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'N' COMMENT '是否删除 删除 Y 未删除 N',
  `edit_count` int(10) NULL DEFAULT NULL COMMENT '编辑次数',
  `time_slot` double NULL DEFAULT NULL COMMENT '时间槽宽度',
  `status` int(255) NULL DEFAULT NULL COMMENT '1:普通码,2:FID,3:错误码',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `time`(`time`) USING BTREE,
  INDEX `index_location`(`location`) USING BTREE,
  INDEX `dept`(`depth`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

