  `gas_trap_lag` double NULL DEFAULT NULL COMMENT '气藏滞后',
  `facility_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '设施的类型',
  `number_slots` int(11) NULL DEFAULT NULL COMMENT '插槽数',
