  `water_depth` double NULL DEFAULT NULL COMMENT '水深',
  `mean_sea_temp` double NULL DEFAULT NULL COMMENT '平均海温',
  `job_number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '工程编号',
  `well_short_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '井名简称',
  `tight_hole` int(1) NULL DEFAULT NULL COMMENT '缩径，1代表是，2代表否',
  `lease_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '租赁的名字，一般不填',
